.region-buttons-shelf {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-auto-rows: 1fr;
    gap: 3%;
    margin-bottom: 40px;
  }

  .region-buttons {
    padding: 10px;
    border-radius: 7px;
    border: 1px solid var(--yuno-purple);
    transition: transform .2s;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  @media only screen and (max-width: 700px) {
    .region-buttons-shelf {
      grid-template-columns: 1fr 1fr;
      gap: 3%;
    }
  }

  @media only screen and (max-width: 400px) {
    .region-buttons-shelf {
      grid-template-columns: 1fr;
      gap: 2%;
    }
  }



  .region-buttons:hover {
    transform: scale(1.02);
    box-shadow: 0 5px 5px var(--yuno-purple-10);
    cursor: pointer;
  }

  .region-buttons .container-region-img {
    border-radius: 50%;
    background-color: rgba(197, 78, 230, 0.1);
    padding: 0.4rem;
    margin-bottom: 15px;
  }

  .region-buttons svg,
  .region-buttons img {
    color: var(--yuno-purple);
    height: 50px;
    /* width: 45px; */
  }

  .region-buttons .central-america-map {
    height: 50px;
    width: 45px;
  }

  .region-buttons h3 {
    font-size: 0.9rem;
    color: var(--yuno-purple);
    margin: 0 0 0 0;
    text-align: center;
  }

   /* ------------------------ define the configuration for DARK Mode ------------------------  */

  @media (prefers-color-scheme: dark) {
    .region-buttons {
      border: 1px solid var(--yuno-purple-50);
    }

      .region-buttons:hover {
      box-shadow: none;
    }

      .region-buttons .container-region-img {
      background-color: var(--yuno-off-white);
    }

      .region-buttons svg,
    .region-buttons img {
      color: var(--yuno-purple-50);

    }

      .region-buttons h3 {
      color: var(--yuno-purple-50);
    }
  }

  [data-color-mode="dark"] .region-buttons {
      border: 1px solid var(--yuno-purple-50);
    }

     [data-color-mode="dark"]  .region-buttons:hover {
      box-shadow: none;
    }

     [data-color-mode="dark"]  .region-buttons .container-region-img {
      background-color: var(--yuno-off-white);
    }

     [data-color-mode="dark"]  .region-buttons svg,
    [data-color-mode="dark"] .region-buttons img {
      color: var(--yuno-purple-50);

    }

     [data-color-mode="dark"]  .region-buttons h3 {
      color: var(--yuno-purple-50);
    }

.table-of-contents-btn-shelf {
    margin: 0 0 0 0;
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: 1fr;
    gap: 10px;
  }

  @media only screen and (max-width: 800px) {
    .table-of-contents-btn-shelf {
      grid-template-columns: repeat(2, 1fr);
    }
  }


  .table-of-contents-btn {
    font-size: 0.85rem;
    border: 1px solid var(--yuno-purple-50);
    display: flex;
    align-items: center;
    gap: 10px;
    padding: 0.6rem;
    border-radius: 7px;
    font-size: 0.85rem;
    color: var(--yuno-purple);
    font-weight: 600;
    transition: transform .1s;
  }

  .table-of-contents-btn-on-click-effects {
    cursor: pointer;
  }

  .table-of-contents-btn-on-click-effects:hover {
    transform: scale(1.02);
    box-shadow: 0 5px 5px var(--yuno-purple-10);
  }

  .table-of-contents-btn .card-logo div {
    height: 23px;
    width: 30px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  /* .table-of-contents-btn .card-name {
    grid-area: name;
    align-self: center;
  } */

  .table-of-contents-btn img {
    max-height: 23px;
    max-width: 23px;
  }

  .table-of-contents-btn .card-title {
    display: inline-block;
    ;
    padding: 0;
    margin: 0;
  }

